import changeTodoDescription from '../actions/changeTodoDescription.action';

const initState = {
    todoDescription: '',
};

const createTodo = (state = initState, action) => {
    switch (action.type) {
        case 'changeTodoDescription':
            return action.createT;
        default:
            return state;
    }
}

export default createTodo;
